import '../../css/bootstrap.css';
import { useState} from "react";




function Purchaseentrysection(){
    const[purchaseentry,setpurchaseentry]= useState();
    let purchaseentryarrray = [];
// for(var i=0;i<=purchaseentryarrray.length-1;i++){
    // for(var j=1;j<=purchaseentryarrray[i].length-1;j++){
        setpurchaseentry(purchaseentryarrray);
    // }
// }
console.log(purchaseentry);
    return(
        <><table className="table datatable text-center">
        <thead>
          <tr>
            <th>PE ID</th>
            <th>PO ID</th>
            <th>Channel</th>
            <th>Invoice No.</th>
            <th>Bill Date</th>
            <th>Bill Total</th>
            <th>Vendor</th>
            <th></th>
            <th></th>
          </tr>
        </thead>
        <tbody>
            <tr>
                {/* {     
                purchaseentry.map((e ,i,key)=>{ 
                <div key={key}>{e[i]}</div>   
                })} */}
            </tr>
          <tr>
            <td>PO-14</td>
            <td>PO-14</td>
            <td><button className="btn btn-sm status_confirmed">Confirmed</button></td>
            <td>LCY-12342</td>
            <td>10/10/2022</td>
            <td>10,000</td>
            <td>Lucky Distributor</td>
            <td><img src={process.env.PUBLIC_URL + "/images/cart.png"} alt="displaying_image" style={{ width: "1.5rem" }} className="me-1" />
              <img src={process.env.PUBLIC_URL + "/images/medicine.png"} alt="displaying_image" className="ms-1" style={{ width: "1.5rem" }} /></td>
            <td><button className="btn position-relative cursor-pointer more p-0 m-0"><img src={process.env.PUBLIC_URL + "/images/more.png"} alt="displaying_image" style={{ width: "1.5rem" }} /></button></td>
          </tr>
        </tbody>
      </table></> 
    )
}


function Purchaseordersection(){
    return(
    <>
    <table className="table datatable text-center">
        <thead>
          <tr>
            <th>PO ID</th>
            <th>Channel</th>
            <th>Vendor</th>
            <th>PO Date</th>
            <th>Created By</th>
            <th>Total Items</th>
            <th>Amount</th>
            <th>Approval Status</th>
            <th></th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>PO-14</td>
            <td><button className="button button-lightblue rounded-5">Pharmacy</button></td>
            <td>Lucky Distributor</td>
            <td>10/10/2022</td>
            <td>Kabir S</td>
            <td>30</td>
            <td>10,000</td>
            <td><button className="button button-lightgreen rounded-5">Approved</button></td>
  
            <td><img src={process.env.PUBLIC_URL + "/images/cart.png"} alt="displaying_image" style={{ width: "1.5rem" }} className="me-1" />
              <img src={process.env.PUBLIC_URL + "/images/medicine.png"} alt="displaying_image" className="ms-1" style={{ width: "1.5rem" }} /></td>
            <td><button className="btn position-relative cursor-pointer more p-0 m-0"><img src={process.env.PUBLIC_URL + "/images/more.png"} alt="displaying_image" style={{ width: "1.5rem" }} /></button></td>
          </tr>
        </tbody>
      </table>
    </>
    )
}


export{Purchaseentrysection};
export{Purchaseordersection};
